"bidder.info.message16":"Ставка на одно транспортное средство стоимостью до $1000","bidder.info.message17":'Добавить 10%-ный депозит от суммы максимальной ставки, чтобы повысить покупательскую способность. Например, если участник плана "Базовый" желает сделать ставку на транспортное средство на сумму до $3000, необходимо внести депозит на сумму $300 до начала размещения ставок.',"bidder.info.message18":"Не более одного участника на аккаунт","bidder.info.message19":'Если лот выиграет участник, зарегистрированный на плане "Базовый", то депозит, сделанный участником плана "Базовый", будет отнесен к сумме покупки и подлежащим оплате сборам. Пользователи плана "Базовый" могут запросить возврат любого непримененного депозита. При возврате всех депозитов будет проведена проверка на предмет привязки данных сумм к активным ставкам или на наличие неуплаченных сборов.',
"bidder.info.message2":"Участники с неактивными учетными записями могут осуществлять поиск транспортных средств и просматривать каталоги, но не могут делать ставки и покупать транспортные средства.","bidder.info.message20":"Ставка на несколько транспортных средств","bidder.info.message21":"Получить значительную покупательскую способность (не требуется дополнительный депозит)","bidder.info.message22":"Добавить трех пользователей аккаунта бесплатно","bidder.info.message23":'При регистрации по плану "Премьер" необходимо оплатить первоначальный регистрационный сбор на сумму $200, внести депозит (залог) на сумму $400 (возвращается в полном размере), а также загрузить все требуемые документы (если применимо). Участники, зарегистрировавшиеся по плану "Премьер", платят ежегодно сбор за продление аккаунта.',
"bidder.info.message24":"Должно быть больше нуля.","bidder.info.message25":"Введите цифровые значения","bidder.info.message26":"Сумма должна быть больше нуля.","bidder.info.message27":"Сумма должна быть указана цифрами.","bidder.info.message3":"Участники с приостановленными учетными записями не имеют доступа к ставкам и покупкам, но их доступ можно восстановить.","bidder.info.message4":'Аккаунты участников со статусом "Заблокировано" удалено навсегда илм закрыты.',"bidder.info.message5":"Участник торгов - любой участник Copart, который размещает ставку на этапе предварительного размещения ставок или во время онлайн аукциона. Используя запатентованную технологию проведения онлайн аукционов, участники Копарт соревнуются друг с другом и пытаются дать ставку выше остальных, чтобы в конечном итоге выиграть понравившееся им транспортное средство.",
"bidder.info.message6":'Участники имеют разные уровни доступа к размещению ставок, определяемые законами штатов и местных органов. Другой фактор, который влияет на право на участие является лицензии, имеющиеся в файлах пользователя Copart. Участники без лицензий на право ведения коммерческой деятельности могут делать ставки в разделе "Лицензия не требуется" (No License Required), однако они должны будут оплатить налог c продажи, если это к ним применимо.',"bidder.info.message7":"Вы уверены, что хотите добавить данные обновления в аккаунт участника?",
